Also four other books by Spiro Constantine Markou. A novel: A Cry of Terror in the
Dark. A work of three stories: The Man Who Loved His Hands and Two Other Stories. A collection of poetry: The Last Tree Burning and Other Poems. And a work on Nietzsche: The Basis for an Understanding of Nietzsche. 

